import React, { useState } from 'react';
import './components/styles/Form.css'
import Form from './components/Form';
function App() {
  const[data,setData]=useState([])
  const[input,setInput]=useState("")

  return (
    <div className="App">
     <Form 
     setInput={setInput}
     input={input}
     data={data}
     setData={setData}
     />


    </div>
  );
}

export default App;
